import React,{Component} from "react";
import TitleName from "./assembly/TitleName";
import SearchTask from "./assembly/SearchTask";
import UngroupedTasks from "./assembly/UngroupedTasks";
import NewTask from "./assembly/NewTask";
import TaskSituation from "./assembly/TaskSituation";

class Test extends Component{
    constructor(props) {
        super(props);
        this.state= {
            inputValue:'',
            List: ['学习React技术', '学习后端API']
        }
    }
    render() {
        return(
            <div className="box">
                <TitleName/>
                <SearchTask/>
                <UngroupedTasks
                    List = {this.state.List}
                />
                <div className="boxNew">
                    <button className="newBtn">新建任务</button>
                    <NewTask
                        // List = {this.state.List}
                        // value = {this.state.inputValue}
                        // onChange={this.newInputChange}
                    />
                </div>
                <TaskSituation/>
            </div>
        );
    }
}
export default Test;
